import React, { Component } from 'react'
import Details from './Details/Details'
import {Link,Switch,Route,Redirect} from 'react-router-dom'

export default class Messages extends Component {
  render() {
    return (
      <div>
        <ul>
          <li>
            {/* <a href="/message1">message001</a>&nbsp;&nbsp; */}
            {/* 引入Detail组件 */}
            <Link to='/home/messages/details'>message001</Link>
          </li>
          <li>
            {/* <a href="/message2">message002</a>&nbsp;&nbsp; */}
            <Link to='/home/messages/details'>message002</Link>
          </li>
          <li>
            {/* <a href="/message/3">message003</a>&nbsp;&nbsp; */}
            <Link to='/home/messages/details'>message003</Link>
          </li>
        </ul>

        <hr />
        <h3>我是Detail的内容</h3>
        <Switch>
          <Route path='/home/messages/details' component={Details}></Route>
          <Redirect to='/home/messages/details'></Redirect>
        </Switch>
      </div>
    )
  }
}
